import { Container, Row, Col, Navbar, Nav, Card, Button } from 'react-bootstrap'; // Zaimportowane komponenty z Bootstrapa
import React, { useEffect, useState } from 'react';
import { Toast } from 'react-bootstrap';

const Home = () => {
    const [showToast, setShowToast] = useState(false);
    const [showRegisterToast, setShowRegisterToast] = useState(false);

    useEffect(() => {
        const isLoggedIn = localStorage.getItem('isLoggedIn');
        if (isLoggedIn === 'true') {
          setShowToast(true);
          localStorage.removeItem('isLoggedIn');
        }
      }, []);

      useEffect(() => {
        const isRegisteredIn = localStorage.getItem('isRegisteredIn');
        if (isRegisteredIn === 'true') {
          setShowRegisterToast(true);
          localStorage.removeItem('isRegisteredIn');
        }
      }, []);

  return (
    <div>
      {/* Nawigacja */}
      <Navbar bg="dark" variant="dark">
        <Navbar.Brand href="#home">Fret Ascend</Navbar.Brand>
        <Nav className="mr-auto justify-content-center">
          <Nav.Link href="#articles">Artykuły</Nav.Link>
          <Nav.Link href="#about">O nas</Nav.Link>
          <Nav.Link href="#contact">Kontakt</Nav.Link>
        </Nav>
        <Nav>
          <Nav.Link href="#profile"><span class="glyphicon glyphicon-user"></span> Profil</Nav.Link>
          <Nav.Link href="#logout"><span class="glyphicon glyphicon-log-in"></span> Wyloguj</Nav.Link>
        </Nav>
      </Navbar>

      {/* Treść strony */}
      <Container fluid>
        <Row className="mt-3">
          <Col md={3}>
            {/* Menu boczne */}
            <Card>
              <Card.Body>
                <Card.Title>Menu</Card.Title>
                <Card.Text>
                  <Nav className="flex-column">
                    <Nav.Link href="#link1">Link 1</Nav.Link>
                    <Nav.Link href="#link2">Link 2</Nav.Link>
                    <Nav.Link href="#link3">Link 3</Nav.Link>
                  </Nav>
                </Card.Text>
              </Card.Body>
            </Card>
          </Col>
          <Col md={9}>
            {/* Lista artykułów */}
            <Card>
              <Card.Body>
                <Card.Title>Artykuły</Card.Title>
                <Card.Text>
                  <Row>
                    {/* Każdy artykuł jako osobna karta */}
                    <Col md={4}>
                      <Card>
                        <Card.Img variant="top" src="https://via.placeholder.com/150" />
                        <Card.Body>
                          <Card.Title>Tytuł artykułu</Card.Title>
                          <Card.Text>
                            Krótki opis artykułu.
                          </Card.Text>
                          <Button variant="primary">Czytaj więcej</Button>
                        </Card.Body>
                      </Card>
                    </Col>
                    {/* Możesz dodać więcej artykułów */}
                  </Row>
                </Card.Text>
              </Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>

      <Toast show={showRegisterToast} onClose={() => setShowRegisterToast(false)} className="position-fixed bottom-0 end-0 m-3">
  <Toast.Header>
    <strong className="me-auto">Pomyślnie zarejestrowano!</strong>
  </Toast.Header>
  <Toast.Body>Twoje konto zostało utworzone.</Toast.Body>
</Toast>

      <Toast show={showToast} onClose={() => setShowToast(false)} className="position-fixed bottom-0 end-0 m-3">
  <Toast.Header>
    <strong className="me-auto">Pomyślnie zalogowano!</strong>
  </Toast.Header>
  <Toast.Body>Witaj! Jesteś zalogowany.</Toast.Body>
</Toast>


    </div>
  );
};

export default Home;
